To create a new Bot, we just need to create a new instance of the commands.Bot class. This class will take two mandatory arguments: command_prefix and intents. command_prefix is the prefix that will be used to invoke the commands. For example, if the prefix is !, then the command !ping will be invoked by typing !ping in the chat. intents is a class that represents the events that the bot will be able to receive. For example, if we want to receive the on_message event, we need to pass the discord.Intents.messages class. import discord
from discord.ext import commands bot = commands.Bot(command_prefix="!", intents=discord.Intents.all()) In this example, we are passing the discord.Intents.all() class, which represents all the intents. This is not recommended, as it can cause performance issues. Instead, we should only pass the intents that we need. For example, if we only need the on_message event, we can pass the discord.Intents.messages class. import discord
from discord.ext import commands bot = commands.Bot(command_prefix="!", intents=discord.Intents.messages())
